import React, { Component } from "react";
import { Container, Icon, Menu, Image } from "semantic-ui-react";
import { Button } from "semantic-ui-react";

export default function Navi() {
  const mystyle = {
    padding: "10px",
  };
  const navistyle = {
    color: "white",
  };

  return (
    <div>
      <Menu style={{ backgroundColor: "#800080" }} fixed="top" size="large">
        <Container style={mystyle}>
          <Image src="images/logo.PNG" size="small" />
          <div class="btn-group">
            <button type="button" class="btn btn-primary">
              Apple
            </button>
            <button type="button" class="btn btn-primary">
              Samsung
            </button>
            <button type="button" class="btn btn-primary">
              Sony
            </button>
          </div>
          {/* <Menu.Item name="Anasayfa" style={navistyle} />
          <Menu.Item name="messages" style={navistyle} />
          <Menu.Item name="friends" style={navistyle} /> */}
          <Container className="d-flex justify-content-end">
            <Button backgroundcolor="grey" inverted color="black">
              {" "}
              <Icon name="shopping cart" />
              Sepetim
            </Button>
          </Container>
        </Container>
      </Menu>
    </div>
  );
}
